import React from "react";

function App() {
  return (
    <React.StrictMode>
      <>
        <div>
          <Header />
          <Main />
        </div>
        <Routes>
          <Route path="/recipes" element={<Recipes />} />
        </Routes>
      </>
    </React.StrictMode>
  );
}

export default App;

function Recipes() {
  return (
    <div>
      <h1>Hello World!</h1>
    </div>
  );
}
